import React, { Component } from 'react';
import './Home.scss';

class Home extends Component {
    render() {
        return (
            <div id="home">
                <div className="name-container">
                    <h1>D'Andre Campbell</h1>
                </div>
                <div className="title-container">
                    <h3>Developer + Photographer</h3>
                </div>              
            </div>
        )
    }
}

export default Home;
